import '../styles/App.css';
import AppContent from './AppContent';
import PricesData from './PricesData';
import AmountsData from './AmountsData.js';
import { request, setAuthHeader } from '../axios_helper';
import Navbar from './view/Navbar.js';
import Header from './view/Header';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {

  login = () => {
    this.setState({ componentToShow: "login" });
  };

  logout = () => {
    this.setState({ componentToShow: "welcome" });
    setAuthHeader(null);
    localStorage.removeItem('token');
  };

  return (
    <Router>
      <div class="container-fluid" >
        <Header pageTitle="Zestawienie danych na temat cen mieszkaÅ„ w okresie ostatnich 10 lat"></Header>
        <Navbar login={this.login} logout={this.logout} /> {/* Dodaj Navbar tutaj */}

        <div className="row">
          <div className="col">
            <Routes>
              <Route path="/" element={<AppContent />} />
              <Route path="/prices" element={<PricesData />} />
              <Route path="/amounts" element={<AmountsData />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>

  );
}

export default App;
